import {Link} from 'react-router-dom';

import socket from '../components/SocketUser';



var profile;                     // google user profile
var userID; 

class Login extends Component {

  constructor(props){
    super(props);
    // this.state = ;
    //you can define initialState with a var, let, or const; OR you can just use this. notation throughout
  }

    responseGoogle = (response) => {
      console.log("FAILED TO SIGN IN. " + JSON.stringify(response));
    }



  render() {
    // const isLoggedIn = this.loggedIn;
    // if (isLoggedIn == false){
    if(this.state.loggedIn == false){
    return(
      <div>
        <h1> TEST </h1>
        <h2> create here </h2>
        <GoogleLogin
          clientId="273539098251-5nhctai82l0ram9s38gkp7s22ahc4lui.apps.googleusercontent.com"
          buttonText="Login"
          onSuccess={this.props.onSignIn}
          onFailure={this.responseGoogle}
          cookiePolicy={'single_host_origin'}
        />
      </div>
      )}
    else{
      return (
        <div>
          <h1> Logged in! </h1>
          <h2> create here </h2>
          <div></div>
          <button id = "SignOut" onClick = {this.onSignOut}> Sign Out Here </button> 
        </div>
      )
    }

  }
}




var test = document.getElementById("test");

test.addEventListener("click", function(){
  socket.emit("createWorkspace", "NAME", "URL");
  console.log("Clicked workspace button");
});

console.log('before the emission');
socket.emit('test', {testing: "0000"});

